import ExpenseItems from "./components/expenseItems";
import Expenses from "./components/Expenses";

function App() {
  const expense = [
    {
      title: "Car insurance",
      date: new Date(2021, 5, 27),
      amount: 356.6,
    },
    {
      title: "Lg UHD",
      date: new Date(2021, 6, 3),
      amount: 233,
    },
    {
      title: "Car insurance",
      date: new Date(2021, 0, 20),
      amount: 356.6,
    },
  ];
  return (
    <div>
      <h1>Let's get started!</h1>
      <Expenses object={expense}/>
    </div>
  );
}

export default App;
